import './App.css';
import Header from "./layout/header";
import Login from "./layout/login";
import Register from "./layout/Register";
import {BrowserRouter, Routes, Route, Navigate} from "react-router-dom";
import Home from "./layout/Home";
import Footer from "./footer";
import {accesPageSecurity} from "./Services/accesPageSecurity";
import Profile from "./layout/User/profile";
import userAuth from "./Auth/userAuth";
import React from "react";
import About from "./layout/About";


function App(){
  return (
      <BrowserRouter>
        <Header/>
        <Routes>
            <Route path="/" element={<Home />}/>
            <Route path="/login" element={<Login />}/>
            <Route path="/register" element={<Register />}/>
            <Route path="/onas" element={<About />}/>
            <Route
                path="/recept/:id"
                element={<DetailRecipe/>}
            />
            <Route path="/recepty" element={<Recipes />}/>
            <Route
                path="/admin/recepty"
                element={accesPageSecurity() ? <AdminRecipes /> : <Navigate to="/" />}
            />


            <Route
                path="/admin/pridatRecept"
                element={accesPageSecurity() ? <AddRecipeForm/> : <Navigate to="/" />}
            />
            <Route path="/profil" element={userAuth.getUser() ? <Profile /> : <Navigate to="/login" />}/>
            <Route
                path="/admin/editRecept/:id"
                element={accesPageSecurity() ? <EditRecipe /> : <Navigate to="/" />}
            />
            <Route
                path="/admin/editUzivatel/:id"
                element={accesPageSecurity() ? <EditUser /> : <Navigate to="/" />}
            />
            <Route
                path="/admin/uzivatele"
                element={accesPageSecurity() ? <AdminUsers /> : <Navigate to="/" />}
            />
            <Route
                path="/admin/pridatUzivatele"
                element={accesPageSecurity() ? <CreateUser/> : <Navigate to="/" />}
            />
        </Routes>
          {userAuth.isAdmin() ? <></> : <Footer />}
      </BrowserRouter>
  );

}

export default App;
